tables.table_schema:
CREATE TABLE fingerprint_matching (
    id INT PRIMARY KEY,
    scanned_fingerprint BYTEA,
    fingerprint_template BYTEA
);

CREATE TABLE scanned_fingerprints (
  fingerprint_id SERIAL PRIMARY KEY,
  fingerprint_data BYTEA
);

CREATE TABLE stored_fingerprint_templates (
  template_id SERIAL PRIMARY KEY,
  template_data BYTEA
);

CREATE TABLE scanned_fingerprint (
    id INT PRIMARY KEY,
    fingerprint_data BYTEA
);

CREATE TABLE fingerprint_template (
    id INT PRIMARY KEY,
    template_data BYTEA
);

CREATE TABLE fingerprint_match (
    id INT PRIMARY KEY,
    scanned_fingerprint_id INT,
    template_id INT,
    match_score FLOAT
);

CREATE TABLE FingerprintTemplate (
	id INT PRIMARY KEY,
	name VARCHAR(50),
	fingerprint VARCHAR(100)
);

CREATE TABLE ScannedFingerprint (
	id INT PRIMARY KEY,
	name VARCHAR(50),
	fingerprint VARCHAR(100)
);

CREATE TABLE MatchResult (
	id INT PRIMARY KEY,
	scanned_fingerprint_id INT,
	fingerprint_template_id INT,
	match_score FLOAT
);

CREATE TABLE MatchHistory (
	id INT PRIMARY KEY,
	match_result_id INT,
	match_date DATE,
	match_time TIME
);
